import Link from 'next/link';

const LandingPage = () => {

  return (
    <div className="landing">
      <span src='../assets/media/yellow-close.png' alt="" className="splash-photo_left"></span>
      <span src='../assets/media/yellow-wide.png' alt="" className="splash-photo_right"></span>
    </div>
  );
};

export default LandingPage;
